import React from "react";
import { BrowserRouter, Route } from "react-router-dom";

const PageOne = () => {
  return <div>pageOne</div>;
};

const PageTwo = () => {
  return (
    <div>
      pageTwo{" "}
      <button onClick={() => this.props.history.push("/changeIndpwd")}>
        click me
      </button>
    </div>
  );
};

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <div>
          <Route path="/" exact component={PageOne}></Route>
          <Route path="/pageTwo" component={PageTwo}></Route>
        </div>
      </BrowserRouter>
    </div>
  );
};

export default App;
